app.controller('loginCtrl',
    function ($scope, $http, $rootScope, $location, SweetAlert, $localStorage, $stateParams, $cookieStore, $filter, $translate) {

        let valitiontext = $filter('translate')('pages.login.messages.validatingTPA');
        let commonTitle = $filter('translate')('common.processing');
        let alertTitle = $filter('translate')('common.alertTitle');

        $scope.tpaName = $stateParams.tpaId;
        $localStorage.tpaName = $scope.tpaName;
        $scope.tpaID = null;
        $scope.loginIconBtnClass = "fa fa-arrow-circle-right";
        $scope.loginBtnClass = "btn btn-primary pull-right";
        $scope.loginboxBackground = "";
        $scope.image = "";
        $scope.bgcolor = "#fff";
        $scope.loginBtnDisabled = false;
        $scope.loginBoxStyle = {};
        $scope.loginBoxStyle = {
            "background": "rgba(0,0,0,0.28)",
            "color": "box-internal-fore-color-white",
            "colorOrd": "#fff",
            "loginbox": "",
            "labelHeading": "box-internal-fore-color-white-heading",
            "outerLogo": false,
            "copyrightLinkColor": "color:#fff",
            "loginInputStype": "",
            "checkboxColor": "",
            "boxAlignClass": "main-login col-xs-10 col-xs-offset-1 col-sm-8 col-sm-offset-4 col-md-4 col-md-offset-4"
        }


        $scope.ContinentalCheck = function () {

            if ($scope.tpaName == "continental" || $scope.tpaName == "LasaCon") {

                $scope.loginBtnClass = "btn btn-primaryCon pull-right";
                $scope.loginboxBackground = " background:black";
                $scope.image = " /TAS.Web/STANDARD/assets/images/new_Loginperkins.jpg";

                $scope.loginBoxStyle = {
                    "background": "black",
                    "color": "box-internal-fore-color-white",
                    "colorOrd": "#fff",
                    "loginbox": "",
                    "outerLogo": false,
                    "copyrightLinkColor": "color:#fff",
                    "labelHeading": "box-internal-fore-color-white-heading",
                    "loginInputStype": "",
                    "checkboxColor": "",
                    "boxAlignClass": "main-login col-xs-10 col-xs-offset-1 col-sm-8 col-sm-offset-2 col-md-4 col-md-offset-1"
                }

                // $scope.image = "/TAS.Web/STANDARD/assets/images/Newlogincont.jpg";
            }
            //else if ($scope.tpaName == "CONTINENTAL" || $scope.tpaName == "Continental" || $scope.tpaName == "continental" || $scope.tpaName == "perkins" || $scope.tpaName == "Perkins" || $scope.tpaName == "PERKINS") {
            //    $scope.image = " /TAS.Webtest/STANDARD/assets/images/new_Loginperkins.jpg";
            //    $scope.loginboxBackground = " background: rgba(228,228,228,0.45)";
            //}
            else if ($scope.tpaName == "perkinsdemo" || $scope.tpaName == "Perkinsdemo" || $scope.tpaName == "PERKINSDEMO") {
                $scope.image = "/TAS.Web/STANDARD/assets/images/new_Loginperkins.jpg";
                $scope.loginboxBackground = " background: rgba(228,228,228,0.45)";

            } else if ($scope.tpaName == "leftfielddemo" || $scope.tpaName == "CycleandCarriage" || $scope.tpaName == "suranjika") {
                $scope.loginBoxStyle = {
                    "color": "box-internal-fore-color-black",
                    "colorOrd": "#000000",
                    "loginbox": "1px solid;border-radius:0px",
                    "labelHeading": "box-internal-fore-color-black-heading",
                    "outerLogo": true,
                    "copyrightLinkColor": "color:#000000",
                    "loginInputStyle": "background-color: #dae3f3;border: 1px solid;border-radius: 0px;",
                    "checkboxColor": "checkbox-color",
                    "boxAlignClass": "main-login col-xs-10 col-xl-2 col-xs-offset-1 col-sm-8 col-sm-offset-2 col-md-3 col-md-offset-2"
                }
                $scope.image = "/TAS.Web/STANDARD/assets/images/extenderdWarrentyLoginPage.png";
            } else {
                $scope.loginboxBackground = "background: rgba(228,228,228,0.28)";
                $scope.image = "/TAS.Web/STANDARD/assets/images/new_LoginBg.jpg";
                $scope.bgcolor = "#4e6c86";
            }
        }


        $scope.ContinentalCheck();

        $scope.loadTPAId = function () {
            swal({ title: commonTitle, text: valitiontext, showConfirmButton: false });
            $http({
                method: 'POST',
                url: '/TAS.Web/api/ProductDisplay/GetTPAIdByName',
                data: { "tpaName": $scope.tpaName },
                async: false
            }).success(function (data, status, headers, config) {
                $scope.tpa = data[0];
                $scope.tpaID = $scope.tpa.Id;
                //$scope.ContinentalCheck();

                if ($scope.tpa.languageCode != undefined && $scope.tpa.languageCode != null) { $translate.use($scope.tpa.languageCode); }
                else { $translate.use('en'); }

                if ($scope.tpa.Logo != '00000000-0000-0000-0000-000000000000' && $scope.tpa.Logo != null) {
                    $http({
                        method: 'POST',
                        url: '/TAS.WEB/api/ProductDisplay/GetTPAImageById',
                        data: { "ImageId": $scope.tpa.Logo, "tpaId": $scope.tpaID, "test": 0 }
                    }).success(function (data, status, headers, config) {
                        $scope.TpaLogoSrc = data;
                        $localStorage.TpaLogoSrc = $scope.TpaLogoSrc;
                    }).error(function (data, status, headers, config) {

                    });
                }
            }).error(function (data, status, headers, config) {

                //  swal(alertTitle, "TPA Name Invalid.", "error");
            }).finally(function () {
                //  swal.close();
                if (!isGuid($scope.tpaID)) {
                    let msgInvalidtpa = $filter('translate')('pages.login.messages.invalidTPA');
                    swal(alertTitle, msgInvalidtpa, "error");
                } else {
                    swal.close();
                }
            });;
        }


        $scope.link = "";
        $scope.err = 0;
        $scope.Errormsg = '';

        $scope.LoginKeyPress = function (e) { if (e.keyCode == 13) $scope.loginAttempt(); }


        $scope.loginAttempt = function () {
            $scope.err = 0;
            $scope.Errormsg = '';
            if ($scope.userName == undefined || $scope.password == undefined || $scope.userName.length == 0 || $scope.password.length == 0) {
                $scope.Errormsg = $filter('translate')('pages.login.messages.errEnterLoginCredentials');
                $scope.err = 1;
            } else {
                $scope.loginBtnDisabled = true;
                $scope.loginIconBtnClass = "fa fa-spinner fa-spin";

                var data = JSON.stringify({ 'UserName': $scope.userName, 'Password': $scope.password, 'tpaID': $scope.tpaID });
                var request = $http({
                    method: "post",
                    url: "/TAS.Web/api/User/LoginAuth",
                    data: data,
                    headers: { 'Authorization': $localStorage.jwt }
                })

                request.success(function (response) {
                    if (response == "Invalid") {
                        $scope.Errormsg = $filter('translate')('pages.login.messages.errInvalidCredentials');
                        $scope.err = 1;
                        $scope.loginBtnDisabled = false;
                        $scope.loginIconBtnClass = "fa fa-arrow-circle-right";
                    } else if (response == "Error") {
                        $scope.Errormsg = $filter('translate')('common.errMessage.systemError');
                        $scope.err = 1;
                        $scope.loginBtnDisabled = false;
                        $scope.loginIconBtnClass = "fa fa-arrow-circle-right";
                    } else if (response == "RestrictedIP") {
                        $scope.Errormsg = $filter('translate')('common.errMessage.restrictedIP');
                        $scope.err = 1;
                        $scope.loginBtnDisabled = false;
                        $scope.loginIconBtnClass = "fa fa-arrow-circle-right";
                    } else {

                        if (response.LanguageCode != undefined && response.LanguageCode != null && response.LanguageCode != '') {
                            $translate.use(response.LanguageCode);
                        }

                        $localStorage.jwt = response.JsonWebToken;
                        $rootScope.LoggedInUserId = response.LoggedInUserId
                        $rootScope.UserType = response.UserType

                        $localStorage.LoggedInUserId = response.LoggedInUserId
                        $localStorage.UserType = response.UserType

                        $localStorage.menuType = 2;
                        $localStorage.tpaID = $scope.tpaID;
                        $localStorage.tpaName = $scope.tpaName;

                        $cookieStore.put('jwt', response.JsonWebToken);
                        $cookieStore.put('LoggedInUserId', response.LoggedInUserId);
                        $cookieStore.put('UserType', response.UserType);

                        $http({
                            method: 'POST',
                            url: '/TAS.Web/api/MakeAndModelManagement/GetAllCommodities',
                            headers: { 'Authorization': $localStorage.jwt == undefined ? jwt : $localStorage.jwt }
                        }).success(function (data, status, headers, config) {
                                $localStorage.CommodityType = data[0].CommodityTypeDescription;
                        }).error(function (data, status, headers, config) {
                        });



                        /////////////////// cookie setup ///////////////////////////////
                        if ($scope.rememberMe) {
                            var request = $http({
                                method: "post",
                                url: "/TAS.Web/api/User/GetCookieToken",
                                data: data
                            });
                            request.success(function (response) {
                                $cookieStore.put('TASToken', response);

                            });
                        } else {
                            $cookieStore.remove('TASToken');
                        }

                        //////////////////end cookie setup//////////////////////////////

                        ///////////////////SignarR Registration//////////////////////////

                        $rootScope.subscribeToSignalrHub();

                        ///////////////////End SignarR Registration//////////////////////////
                        $http({
                            method: 'POST',
                            url: '/TAS.Web/api/User/GetMenu',
                            headers: { 'Authorization': $localStorage.jwt },
                            async: false
                        }).success(function (data, status, headers, config) {
                            $localStorage.Menu = data;
                            $rootScope.setMenuCookie(true);
                        }).error(function (data, status, headers, config) {
                        });

                        if ($rootScope.UserType == "IU" || $rootScope.UserType == "DU") {
                            $http({
                                method: 'POST',
                                url: '/TAS.Web/api/User/GetUsersById',
                                data: { "Id": $rootScope.LoggedInUserId },
                                headers: { 'Authorization': $localStorage.jwt }
                            }).success(function (data, status, headers, config) {
                                //setting up logged in user details
                                $localStorage.currentUsername = data.FirstName;
                                $rootScope.user.name = data.FirstName;
                                $localStorage.ReinsurerId = data.ReinsurerId;
                                showProfilePicture(data.ProfilePicture);

                                if (!$rootScope.$$phase) {
                                    $rootScope.$apply();
                                }
                                //end of user
                                //alert($location.search().redirectto);
                                if (typeof $location.search().redirectto != 'undefined') {
                                    if ($location.search().redirectto.startsWith('/login/')) {
                                        $location.path("app/dashboard");
                                    } else {
                                        $location.path($location.search().redirectto);
                                    }

                                } else {
                                    if ($localStorage.tpaName.toUpperCase() == "CONTINENTAL" && $rootScope.UserType == "DU") {
                                        $location.path("app/dealerinvoicecodenew");
                                    } else {
                                        $location.path("app/dashboard");
                                    }
                                }

                            }).error(function (data, status, headers, config) {
                            });
                        }
                        else if ($rootScope.UserType == "CU") {
                            $http({
                                method: 'POST',
                                url: '/TAS.Web/api/Customer/GetCustomerById',
                                data: { "Id": $rootScope.LoggedInUserId },
                                headers: { 'Authorization': $localStorage.jwt }
                            }).success(function (data, status, headers, config) {
                                $localStorage.user = data;
                                $location.path("app/dashboard");
                            }).error(function (data, status, headers, config) {
                            });

                        } else if ($rootScope.UserType == "RI") {
                            $http({
                                method: 'POST',
                                url: '/TAS.Web/api/User/GetUsersById',
                                data: { "Id": $rootScope.LoggedInUserId },
                                headers: { 'Authorization': $localStorage.jwt }
                            }).success(function (data, status, headers, config) {
                                $localStorage.currentUsername = data.FirstName;
                                $rootScope.user.name = data.FirstName;
                                showProfilePicture(data.ProfilePicture);
                                $localStorage.ReinsurerId = data.ReinsurerId;
                                if (!isGuid(data.ReinsurerId)) {
                                    SweetAlert.swal({
                                        title: alertTitle,
                                        text: $filter('translate')('pages.login.messages.errReinsurerNotAssign'),
                                        type: "warning",
                                        confirmButtonColor: "rgb(221, 107, 85)"
                                    });
                                    $localStorage.jwt = "";
                                } else {
                                    $location.path("app/dashboard");
                                }

                                if (!$rootScope.$$phase) {
                                    $rootScope.$apply();
                                }

                            }).error(function (data, status, headers, config) {

                            });
                        }

                        $scope.Errormsg = $filter('translate')('common.errMessage.errOcured');
                        $scope.loginBtnDisabled = false;
                        $scope.loginIconBtnClass = "fa fa-arrow-circle-right";

                        return false;
                    }

                });
                request.error(function (response) {
                    $scope.Errormsg = $filter('translate')('common.errMessage.errOcured');
                    $scope.loginBtnDisabled = false;
                    $scope.loginIconBtnClass = "fa fa-arrow-circle-right";
                });

            }

        }

        $scope.navigateToForgotPassword = function () {
            $location.path("login/forgot/" + $scope.tpaID);
        }
        function showProfilePicture(ProfilePictureId) {
            if (ProfilePictureId != null && ProfilePictureId != "00000000-0000-0000-0000-000000000000") {
                $http({
                    method: 'POST',
                    url: '/TAS.Web/api/Image/GetImageById',
                    headers: { 'Authorization': $localStorage.jwt == undefined ? jwt : $localStorage.jwt },
                    data: { 'ImageId': ProfilePictureId },
                }).success(function (data, status, headers, config) {
                    //$rootScope.user.picture = data;
                    $localStorage.currentProfilePic = data;
                    $rootScope.user.picture = data;
                }).error(function (data, status, headers, config) {
                });
            } else {
                $localStorage.currentProfilePic = "";
                $rootScope.user.picture = "";
            }

        }
        function isGuid(stringToTest) {
            var validGuid = /^({|()?[0-9a-fA-F]{8}-([0-9a-fA-F]{4}-){3}[0-9a-fA-F]{12}(}|))?$/;
            var emptyGuid = /^({|()?0{8}-(0{4}-){3}0{12}(}|))?$/;
            return validGuid.test(stringToTest) && !emptyGuid.test(stringToTest);
        }
    });

